/*Table structure for table `jl_level` */

CREATE TABLE `jl_level` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `lv` int(2) DEFAULT '0' COMMENT '等级',
  `title` varchar(255) DEFAULT '' COMMENT '标题',
