  `code_reward` decimal(18,2) DEFAULT NULL COMMENT '激活码直推',
  `buy_reward` decimal(18,2) DEFAULT NULL COMMENT '分润直推',
  `team_reward` decimal(18,2) DEFAULT NULL COMMENT '极差',
