/*Table structure for table `jl_quant_robot` */

CREATE TABLE `jl_quant_robot` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` bigint(20) NOT NULL COMMENT '用户ID',
  `platform` varchar(100) NOT NULL COMMENT '平台',
  `type` int(5) NOT NULL DEFAULT '1' COMMENT '1 现货spot',
  `market_id` int(10) NOT NULL COMMENT '交易市场',
  `first_order_value` float(9,2) NOT NULL COMMENT '首单金额 USDT',
  `is_double` tinyint(1) DEFAULT '0' COMMENT '0否  1是   是否加倍',
  `max_order_count` int(10) NOT NULL COMMENT '做单数量',
  `stop_profit_rate` float(9,2) NOT NULL COMMENT '止盈比例',
  `stop_profit_callback_rate` float(9,2) NOT NULL COMMENT '止盈回调',
  `cover_rate` float(9,2) NOT NULL COMMENT '补仓跌幅',
  `cover_callback_rate` float(9,2) NOT NULL COMMENT '补仓回调',
  `values_str` text NOT NULL COMMENT '机器人运行时变量，重启后清空',
  `recycle_status` int(11) NOT NULL COMMENT '0单次策略 1循环策略',
  `cd_key` varchar(200) DEFAULT '' COMMENT '量化机器人激活码',
  `show_msg` varchar(200) DEFAULT '' COMMENT '机器人展示状态信息',
  `revenue` decimal(40,18) NOT NULL DEFAULT '0.000000000000000000' COMMENT '更新收益',
  `is_clean` int(5) NOT NULL DEFAULT '0' COMMENT '清仓卖出',
  `status` int(10) NOT NULL COMMENT '量化机器人状态 0暂停 1正常',
  `ctime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `cover_rates` varchar(255) NOT NULL COMMENT '补仓率  范围',
  `run_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0未运行  1运行中',
  `sell_status` tinyint(1) DEFAULT '0' COMMENT '1 卖出失败  后台操作',
  `order_status` int(4) DEFAULT '0' COMMENT '0 交易中 1 交易完成',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=290 DEFAULT CHARSET=utf8;

