/*Table structure for table `jl_quant_robot_order` */

CREATE TABLE `jl_quant_robot_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `uid` bigint(20) NOT NULL COMMENT '用户ID',
  `platform` varchar(100) NOT NULL COMMENT '平台',
  `type` int(5) NOT NULL DEFAULT '1' COMMENT '1 现货spot',
  `order_id` varchar(200) NOT NULL DEFAULT '' COMMENT '订单ID',
  `qrobot_id` bigint(20) NOT NULL COMMENT '量化机器人ID',
  `side` int(4) NOT NULL COMMENT '1 卖 2买',
  `market` varchar(100) NOT NULL COMMENT '市场',
  `stock` varchar(100) NOT NULL COMMENT 'stock',
  `money` varchar(100) NOT NULL COMMENT 'money',
  `deal_money` decimal(40,18) DEFAULT NULL COMMENT '成交总量',
  `deal_amount` decimal(40,18) NOT NULL COMMENT '成交数量',
  `price` decimal(40,18) NOT NULL COMMENT '成交均价',
  `order_status` int(4) NOT NULL COMMENT '订单状态 2部分成交 1完全成交 0待成交 -1撤单',
  `is_first` int(4) NOT NULL DEFAULT '0' COMMENT '是否是首单 1是 2尾单',
  `pid` varchar(200) NOT NULL DEFAULT '' COMMENT '每次启动时候的UUID',
  `ctime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '订单时间',
  `revenue` decimal(30,15) DEFAULT '0.000000000000000' COMMENT '收益',
  `total` decimal(50,15) DEFAULT '0.000000000000000' COMMENT '下单总金额 USDT',
  `fee` decimal(30,15) DEFAULT '0.000000000000000' COMMENT '手续费',
