/*Table structure for table `jl_transfer_log` */

CREATE TABLE `jl_transfer_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL COMMENT '用户ID',
  `type` int(11) NOT NULL COMMENT '1 云端转出 2 云端充值 3 购买激活码 4 信用值扣除 5 分润扣除 6 分润增加',
  `wallet_type` int(11) NOT NULL DEFAULT '1' COMMENT '1 云端钱包  2 HD钱包',
  `related_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联ID',
  `wallet_id` int(11) NOT NULL COMMENT '钱包名称',
  `coin_symbol` varchar(255) NOT NULL COMMENT '币种名称',
  `from_address` varchar(255) NOT NULL DEFAULT '' COMMENT '转账地址',
  `to_address` varchar(255) NOT NULL DEFAULT '' COMMENT '转账地址',
  `address_memo` varchar(255) NOT NULL DEFAULT '' COMMENT '地址memo',
  `amount` decimal(30,18) NOT NULL DEFAULT '0.000000000000000000' COMMENT '转账数量',
  `amount_before` decimal(30,18) NOT NULL DEFAULT '0.000000000000000000' COMMENT '转账前余额',
  `amount_after` decimal(30,18) DEFAULT '0.000000000000000000' COMMENT '转账后余额',
  `fee` decimal(30,18) NOT NULL DEFAULT '0.000000000000000000' COMMENT '转账手续费',
  `log_time` int(11) NOT NULL DEFAULT '0' COMMENT '转账时间',
  `tx_id` varchar(255) NOT NULL DEFAULT '' COMMENT '链上交易ID',
  `blockhash` varchar(255) NOT NULL DEFAULT '' COMMENT '区块hash',
  `memo` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `transfer_status` int(2) NOT NULL DEFAULT '0' COMMENT '-1 失败 0等待处理 2转账中 1 转账成功',
  `raw` text COMMENT 'HD钱包交易数据流',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`) USING BTREE,
  KEY `type` (`type`) USING BTREE,
  KEY `walljl_type` (`wallet_type`) USING BTREE,
  KEY `related_id` (`related_id`) USING BTREE,
  KEY `coin_symbol` (`coin_symbol`(191)) USING BTREE,
  KEY `transfer_status` (`transfer_status`) USING BTREE,
  KEY `log_time` (`log_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5700 DEFAULT CHARSET=utf8mb4;

/*Data for the table `jl_transfer_log` */

/*Table structure for table `jl_user` */

CREATE TABLE `jl_user` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_login` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '用户名',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '中国手机不带国家代码，国际手机号格式为：国家代码-手机号',
  `sex` tinyint(2) NOT NULL DEFAULT '0' COMMENT '性别;0:保密,1:男,2:女',
  `birthday` int(11) NOT NULL DEFAULT '0' COMMENT '生日',
  `last_login_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后登录时间',
  `cuc` float(50,18) DEFAULT '0.000000000000000000' COMMENT 'cuc数量',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '用户积分',
  `coin` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '金币',
  `balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '余额',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '注册时间',
  `user_status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '用户状态;0:禁用,1:正常,2:未验证',
  `user_nickname` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '用户昵称',
  `user_pass` varchar(64) NOT NULL DEFAULT '' COMMENT '登录密码;cmf_password加密',
  `user_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '用户类型;1:admin;2:会员',
  `user_email` varchar(100) NOT NULL DEFAULT '' COMMENT '用户登录邮箱',
  `user_url` varchar(100) NOT NULL DEFAULT '' COMMENT '用户个人网址',
  `avatar` varchar(255) NOT NULL DEFAULT '' COMMENT '用户头像',
  `signature` varchar(255) NOT NULL DEFAULT '' COMMENT '个性签名',
  `last_login_ip` varchar(15) NOT NULL DEFAULT '' COMMENT '最后登录ip',
  `user_activation_key` varchar(60) NOT NULL DEFAULT '' COMMENT '激活码',
  `more` text COMMENT '扩展属性',
  `invitation_code` varchar(32) NOT NULL DEFAULT '' COMMENT '邀请码',
  `level` tinyint(2) DEFAULT '0' COMMENT '用户等级 0未激活  1一星 2二星 3三星 4四星 5五星 6合伙人',
  `parent_user_id` int(11) NOT NULL DEFAULT '0' COMMENT '直推上级用户ID',
  `parent_tree` text COMMENT '上级用户ID树，|竖线分割',
  `invitation_count` int(11) NOT NULL DEFAULT '0' COMMENT '直推下级人数',
  `invite_count` int(11) DEFAULT '0' COMMENT '直推成为一星会员人数',
  `team_all_count` int(11) DEFAULT '0' COMMENT '团队总人数  包括未激活人数',
  `team_user_count` int(11) DEFAULT '0' COMMENT '团队人数',
  `has_paypwd` int(2) unsigned NOT NULL DEFAULT '0' COMMENT '是否有支付密码（1：有，0：无）',
  `paypwd` varchar(64) DEFAULT '' COMMENT '支付密码',
  `paypwd_count` int(10) DEFAULT '0' COMMENT '累计错误次数',
  `paypwd_last_time` int(10) DEFAULT '0' COMMENT '提交时间',
  `auth_id` tinyint(4) NOT NULL DEFAULT '1' COMMENT '认证等级',
  `is_google_check` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '是否开启谷歌验证（1：是，0：否）',
  `google_check_key` varchar(255) DEFAULT NULL COMMENT '谷歌验证密钥',
  `google_check_key_img` varchar(255) DEFAULT NULL COMMENT '谷歌验证二维码',
  `is_activate` tinyint(1) DEFAULT '0' COMMENT '0 未激活  1已激活',
  `pid` int(11) DEFAULT NULL COMMENT '推荐人id',
  `path_id` text COMMENT '推荐人路径',
  `end_time` int(10) DEFAULT '0' COMMENT '到期时间',
  `is_first` tinyint(1) DEFAULT '0' COMMENT '0第一次 1 否',
  PRIMARY KEY (`id`),
  KEY `user_login` (`user_login`) USING BTREE,
  KEY `user_nickname` (`user_nickname`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=100161 DEFAULT CHARSET=utf8mb4 COMMENT='用户表';

