  KEY `type` (`type`) USING BTREE,
  KEY `status` (`status`) USING BTREE,
  KEY `chain_update_time` (`chain_update_time`) USING BTREE,
  KEY `add_time` (`add_time`) USING BTREE,
  KEY `address` (`address`(191)) USING BTREE
